                <p class="description">
                    1913-ban Budapesten kívül 70 olyan város volt, ahol rendszeresen rendeztek színházi
                    bemutatókat. Ebből Trianon következében 1920-ra 44 a határokon túlra került. Az új hatalmak
                    – Románia, Csehszlovákia, Szerbia, Horvátország – adminisztratív eszközökkel (de volt, hogy
                    erőszakkal), akadályozták a magyar nyelvű társulatok működését. A Nemzeti Színház emlékműve
                    és a hozzá kapcsolódó virtuális kiállítás az 1918–1921-es időpillanatot, a magyar színházak
                    Trianonját idézi meg.
